pragma solidity ^0.4.21;

contract ProxyContract {

    function setValue(bytes32[] keys, bytes32[] values) public {
        address initializationContract = 0x8888888888888888888888888888888888888888;
        require(msg.sender == initializationContract);
        require(keys.length == values.length);
        for(uint i = 0; i < keys.length; i++) {
            assembly {
                sstore(mload(add(add(keys, 0x20), mul(i, 0x20))), mload(add(add(values, 0x20), mul(i, 0x20))))
            }
        }
    }

    //https://blog.gnosis.pm/solidity-delegateproxy-contracts-e09957d0f201
    function() public payable {
        bool success = 0x2222222222222222222222222222222222222222.delegatecall(msg.data);
        assembly {
            let mempointer := mload(0x40)
            returndatacopy(mempointer, 0, returndatasize())
            switch success
            case 0 { revert(mempointer, returndatasize()) }
            default { return(mempointer, returndatasize()) }
        }
    }
}

